                        if (!$this.closest('div.dropdown').length && !$this.closest('input').length) {
                            let parent = $this.parents('th'),
                                index = parent.index();
                            if (parent.hasClass('sorting_asc')) {
                                instance.column(index).order('desc').draw();

                            } else {
                                instance.column(index).order('asc').draw();
                            }
                        }
